import React from "react";
type User = {name: String, age: Number}
const user: User = {
  name: 'Manjunath R',
  age: 32,
}

const Typescript = () => {
  return (
    <div>
      <h1>Hello Duniya!!!</h1>
      <div>I'm {user.name} and I'm <span>{user.age}</span> years old</div>
    </div>
  )
}

export default Typescript;
